- input: "TEXT\x1CC00396655\x1C2\x1C\x1CSA11AI\x1C\"The previous Mid-Year Report,
    as amended, included a receipt of $2,704.19 from the San Antonio Police Association
    which was itemized on Schedule A supporting Line 17.  This receipt has been removed
    from this report because our audit indicates that this entry did not represent
    an actual transaction, but rather voided disbursements which have since been appropriately
    disclosed on amended reports filed today.  The remaining entry of $6,503.38 from
    the Association is still itemized on this report as received.  We believe this
    receipt was due to be returned to the PAC account, and we believe that there were
    enough permissible funds in the Association account to cover the receipt; however,
    we are prepared to transfer these funds out of the PAC account because our recordkeeping
    does not clearly explain the reason for the return of these funds.\""
  record: fec.version.v6_2.TEXT
